defmodule ImplementStrStrTest do
  use ExUnit.Case
  doctest ImplementStrStr

  test "empty string" do
    assert ImplementStrStr.str_str("hello", "") == 0
  end

  test "string with matching text" do
    assert ImplementStrStr.str_str("hello", "ll") == 2
  end

  test "string without matching text" do
    assert ImplementStrStr.str_str("hello", "lla") == -1
  end

  test "string without matching text 2" do
    assert ImplementStrStr.str_str("aaaaa", "bba") == -1
  end

  test "string with haystack equals to needle" do
    assert ImplementStrStr.str_str("a", "a") == 0
  end

  test "string with haystack similar to needle" do
    assert ImplementStrStr.str_str("aaa", "aaaa") == -1
  end

  test "string with needle matching in the last char" do
    assert ImplementStrStr.str_str("abc", "c") == 2
  end

  test "string with multiple matches in the end" do
    assert ImplementStrStr.str_str("mississippi", "issip") == 4
  end

  @tag :skip
  test "very very big strings" do
    haystack = ""
    needle = ""
    assert ImplementStrStr.str_str(haystack, needle) == 4
  end
end
